import { jsPDF } from "jspdf";

jsPDF.API.events.push([
  "addFonts",
  function () {
    this.addFileToVFS(
      "Gloock-Regular.ttf",
      ""
    );
    this.addFont("Gloock-Regular.ttf", "Gloock", "normal");

    this.addFileToVFS(
      "Lato-Light.ttf",
      ""
    );
    this.addFont("Lato-Light.ttf", "Lato", "normal");
  },
]);
